static void _cbDialog(WM_MESSAGE * pMsg) {
    int i;
    WM_HWIN hItem;
    int     NCode;
    int     Id;
    gui_msg_t msg;
    msg.exec = RT_NULL;
    
    switch (pMsg->MsgId)
    {
        case WM_INIT_DIALOG:
            hItem = pMsg->hWin;
            FRAMEWIN_SetTitleVis(hItem, 0);
            hItem = WM_GetDialogItem(pMsg->hWin, ID_ICONVIEW_0);
           // ICONVIEW_SetSpace(hItem, GUI_COORD_X, 50);
           // ICONVIEW_SetSpace(hItem, GUI_COORD_Y, 50);
           // ICONVIEW_SetIconAlign(hItem, ICONVIEW_IA_LEFT | ICONVIEW_IA_TOP);
           // ICONVIEW_SetBkColor(hItem, ICONVIEW_CI_SEL, GUI_BLUE | 0xC0000000);
           // ICONVIEW_SetFont(hItem, &GUI_Font13B_ASCII);
            for (i = 0; i < 7; i++)
            {  
            //    ICONVIEW_AddBitmapItem(hItem, &_bmBrowser, "Test");
            }
            break;
        case WM_NOTIFY_PARENT:
            Id    = WM_GetId(pMsg->hWinSrc);
            NCode = pMsg->Data.v;

    if(NCode == WM_NOTIFICATION_RELEASED)
    {
        switch (Id)
        {
            case ID_BUTTON_0:
                msg.exec = GUI_AppDispCalender;
                break;
            case ID_BUTTON_1:
                msg.exec = GUI_AppDispSysInfo;
                break;
            case ID_BUTTON_2:
                msg.exec = GUI_AppDispTime;
                break;
            case ID_BUTTON_3:
                msg.exec = GUI_AooDispChooseFile;
                break;
            case ID_BUTTON_4:
                msg.exec = GUI_ExecCalibrationDialog;
                break;      
            case ID_BUTTON_5:
                msg.exec = GUI_CreateTaskerDialog;
                break;
            default:
                break;    
        }
        if(msg.exec != RT_NULL)
        {
            rt_mq_send(guimq, &msg, sizeof(msg));
        }
    }

    default:
        WM_DefaultProc(pMsg);
        break;
    }
}



